import styled from "styled-components";
import { Link } from "react-router-dom";
import logo from "../HOME/LogoPI.png";

export default function HomeMain() {
  return (
    <HomeContainer>
      <div className="curve"></div>
      <div>
        <img src={logo} alt="logo" />
      </div>

      <Intro>
        <h1>Consulta información relevante sobre tus paises preferidos.
        Entra
        a la siguiente sección y disfruta del contenido.</h1>
      </Intro>
      <Link to="/countries">Explorar</Link>
    </HomeContainer>
  );
}

const HomeContainer = styled.main`
  display: flex;
  flex-direction: column;
  justify-content: space-around;
  align-content: space-around;
  align-items: flex-start;
  height: 50rem;
  background-color: #2b3240;
  /* position: relative; */
  padding-left: 15rem;
  img{
    height: 30rem;
  }
  h1{
    color: #A0C0D6;
      box-shadow: 1px 1px 400px -24px rgba(0,0,0,0.75);
-webkit-box-shadow: 1px 1px 400px -24px rgba(0,0,0,0.75);
-moz-box-shadow: 1px 1px 400px -24px rgba(0,0,0,0.75);
  }
`;

const Intro = styled.section`
  background-color: #43597D;
  text-align: center;
  color: #A0C0D6;
      box-shadow: 1px 1px 400px -24px rgba(0,0,0,0.75);
-webkit-box-shadow: 1px 1px 400px -24px rgba(0,0,0,0.75);
-moz-box-shadow: 1px 1px 400px -24px rgba(0,0,0,0.75);
`;
